                public static class CoverBean implements Parcelable {
                    /**
                     * feed : http://img.kaiyanapp.com/3094d0a612b889d6d928c568a252a8a0.jpeg?imageMogr2/quality/60
                     * detail : http://img.kaiyanapp.com/3094d0a612b889d6d928c568a252a8a0.jpeg?imageMogr2/quality/60
                     * blurred : http://img.kaiyanapp.com/ce0e8a96ca74fdfb7854e47c201af1e5.jpeg?imageMogr2/quality/60
                     * sharing : null
                     */

                    private String feed;
                    private String detail;
                    private String blurred;
                    private Object sharing;

                    protected CoverBean(Parcel in) {
                        feed = in.readString();
                        detail = in.readString();
                        blurred = in.readString();
                    }

                    public static final Creator<CoverBean> CREATOR = new Creator<CoverBean>() {
                        @Override
                        public CoverBean createFromParcel(Parcel in) {
                            return new CoverBean(in);
                        }

                        @Override
                        public CoverBean[] newArray(int size) {
                            return new CoverBean[size];
                        }
                    };

                    public String getFeed() {
                        return feed;
                    }

                    public void setFeed(String feed) {
                        this.feed = feed;
                    }

                    public String getDetail() {
                        return detail;
                    }

                    public void setDetail(String detail) {
                        this.detail = detail;
                    }

                    public String getBlurred() {
                        return blurred;
                    }

                    public void setBlurred(String blurred) {
                        this.blurred = blurred;
                    }

                    public Object getSharing() {
                        return sharing;
                    }

                    public void setSharing(Object sharing) {
                        this.sharing = sharing;
                    }

                    @Override
                    public int describeContents() {
                        return 0;
                    }

                    @Override
                    public void writeToParcel(Parcel dest, int flags) {
                        dest.writeString(feed);
                        dest.writeString(detail);
                        dest.writeString(blurred);
                    }
                }

